import React from "react";
import styles from "./Operlist.module.css"
import { useNavigate } from 'react-router-dom';


const Operlist = () => {
    const navigate = useNavigate();

    const onClickApplicant =() => {
        navigate('/Adminpage')
    }

    const onClickReservation =() => {
        navigate('/Adminpage')
    }

    const onClickInputApplicant =() => {
        navigate('/Adminpage')
    }

    return (
        <div className={styles.layOutStyle}>
            <Element onClick={onClickApplicant}>신청자</Element>
            <Element type='button' onClick={onClickReservation}>예약</Element>
            <Element type='button' onClick={onClickInputApplicant}>신청자입력</Element>
        </div>
    )
}

export default Operlist;
